import React from "react";
import styled from "styled-components";
import { useHistory } from "react-router-dom";
import { NavLink as Link } from "react-router-dom";
import Home from "../pages/Home";
function Navbar() {

  const history = useHistory();
  const HomeClick = () => history.push("./");
  const BuyClick = () => history.push("./Buy");
  const SellClick = () => history.push("./Sell");
  const ManagedClick = () => history.push("./Managed");
  const AboutAutohub = () => history.push("./AboutAutohub");
  const CCenterClick = () => history.push("./CCenter");
  const JoinClick = () => history.push("./Join");
  const LoginClick = () => history.push("./Login");




  return (
    <Body>
    <Header>

<AutohubLogo src="/images/AUTOHUB Logo.png" />

  <HeaderRightListPart>
<HeaderRightList href="#">   살때</HeaderRightList>
<HeaderRightList href="#">  팔때</HeaderRightList>
<HeaderRightList href="#">   직영차</HeaderRightList>
<HeaderRightList href="#">  단지안내</HeaderRightList>
<HeaderRightList href="#">고객센터</HeaderRightList>
  </HeaderRightListPart>


    </Header>

      </Body>
  );
}

const Body = styled.body`
box-sizing: border-box;
margin: 0;
padding: 0;
`
const Header = styled.header`
height: 60px;
background-color:#f11843 ;
color: #fff;
`;

const AutohubLogo = styled.img`
width: 170px;
float: left;
padding-top: 10px;
margin-left: 50px;
cursor: pointer;
`;

const HeaderRightListPart = styled.ul`

`;
const HeaderRightList = styled.a`
text-decoration: none;
color: #fff;
font-weight: bold;
font
`;


export default Navbar;
